import React from "react";
import { BrowserRouter as Router , Link, Route} from "react-router-dom";

const AnaSayfa=(props)=>{
  return <p>AnaSayfa</p>
};


const App = () => {
  return (
    <>
        < Router>
        <div className="App">
           
          <h1>Teknolojik Yemekler</h1>
          <p><Link to="/anaSayfa">Ana Sayfa</Link></p>

         <Route path="/" component={AnaSayfa}/>
        
        </div>
      </ Router>
      
    </>
  );
};


export default App;
